import React from 'react';

const Contact = () => {
  return (
    <div name='contact' className='w-full min-h-screen text-gray-200 bg-[#0a192f]'>
      <div className='max-w-6xl mx-auto px-8 flex flex-col justify-center h-full'>
        <div className='text-center pb-8'>
          <h1 className='text-4xl font-bold inline-block border-b-4 border-pink-600'>
            Contact
          </h1>
        </div>
        <div className='flex flex-col items-center justify-center'>
          <p
            onClick={() => window.open('https://discord.gg/uxDgVAJcSN')}
            className='text-2xl md:text-3xl text-[#4ecad3] font-bold border-b-2 border-pink-600 hover:text-purple-600 hover:border-b-2 cursor-pointer transition duration-300'
          >
            Click here for more of my creations!
          </p>
          <p className='text-3xl md:text-4xl mt-6 text-[#8d8dca] font-semibold'>
            Thanks for showing interest in my work!
          </p>
          <p className='text-4xl md:text-5xl text-pink-600 font-bold mt-2'>
            You can message me on Discord: wuluu#0827
          </p>
        </div>
      </div>
    </div>
  );
};

export default Contact;
